import React from "react";


function Projects(props) {
  return (
    <div className="projectTile">
    <div>
      <a>
        <img src="images/"/>
      </a>
    </div>
      <div>
        <h1>{props.title}</h1>
      </div>
      <div>
        <h4>{props.components}</h4>
      </div>
      <div>
        <p>{props.text}</p>
      </div>
      
    </div>
  );
}

export default Projects;
